import React, { createRef, useEffect } from 'react';
import { Bar } from 'react-chartjs-2';

const TableItem = (data) => {
    const chartRef = createRef();

    useEffect(() => {
        const myChart = new Chart(chartRef, {
            type: Bar
        });
    });

    return (
        <div className="TableITem">
            <canvas ref={chartRef}/>
        </div>
    )
}

export default TableItem;
